@Mortomis: I also touched the theme of the doll in the comments I made about that saga, and yes, it is a point that not all take into account, because it seems a minor detail, until you think about it and you realize that. In fact, every time Shuei sees or takes it, Mashiro appears ... Also, every time he takes the doll, he does not remember how he got there or why they kept that object ...

What surprised me from the beginning was the attitude of the parents. The first time we see Shuei returning to his parents' house [I do not know if it will be for the translation], but it seems that things are quite tense between them. The father also seems to know that Mashiro is in the storage room, because he asks: "Why do you want to go in there?" and it feels like he knows something ...

Another interesting point is the "Alternative"saga "Shira Ganase [Dar-Ning, Tojinawa ... etc] in which Mashiro and Shuei are a couple, but never mention the parents of this....
